INSERT INTO `categorias` (`idCategoria`, `NombreCategoria`, `Descripcion`) VALUES
(1, 'Abstracto', 'La abstracción es una operación mental destinada a aislar conceptualmente una propiedad o función concreta de un objeto, y pensar qué es, ignorando otras propiedades del objeto en cuestión.'),
(3, 'Figurativa', 'Arte figurativo, figurativismo o arte representacional es el arte que, al contrario que el arte abstracto, se define por la representación​ de figuras, entendiendo estas como objetos identificables '),
(4, 'Geométrica', 'Definición. Tendencia artística abstracta en la que se disponen composicionalmente elementos geométricos, trazados verticales, horizontales y diagonales, líneas uniformes y planos cromáticos. En el arte geométrico resulta medular la síntesis, respecto de las formas utilizadas, la estructura y el color.'),
(10, 'PopArt', 'Arte pop es un movimiento artístico surgido en Reino Unido y Estados Unidos a mediados del siglo XX, inspirado en la estética de la vida cotidiana y los bienes de consumo de la época, tales como anuncios publicitarios, comic books, objetos culturales «mundanos» y del mundo del cine. '),
(11, 'Cerámica', 'La cerámica es el arte de fabricar vasijas​ y otros objetos de arcilla u otro material cerámico por acción del calor, es decir cocida a una temperatura superior a los 900 grados.​ '),
(12, 'Blanco-Negro', 'Aunque la fotografía de color devino común a mitad del siglo XX, el blanco y negro se usa aún con propósitos artísticos, bien con película en blanco y negro o mediante conversión digital. ​La pintura: En la pintura y el dibujo, el blanco y negro sirve para resaltar los volúmenes.'),
(13, 'Color', 'El color en el arte es un aspecto muy importante de las artes visuales o plásticas, junto con otros elementos como la luz, la atmósfera,​ el fondo y la forma, la materia, la línea, el punto, la mancha, el volumen, el espacio,​ el movimiento,​ la textura, el formato, etc.'),
(15, 'Natural', 'asgh.hfdghd'),
(16, 'Retratos', 'retrato es aquella que se refiere a la expresión plástica de una persona a imitación de la misma, lo que ocurre en la pintura, la escultura y la fotografía. Se pretende mostrar la semejanza, personalidad e incluso el estado de ánimo de la persona.'),
(17, 'Dibujo', 'El dibujo es el arte de representar gráficamente objetos sobre una superficie plana; es base de toda creación plástica y es un medio convencional para expresar la forma de un objeto mediante líneas o trazos. Las técnicas de pintar y dibujar pueden confundirse, porque las herramientas son en ocasiones las mismas.'),
(18, 'Collage', 'El collage es una técnica artística que consiste en pegar distintas imágenes sobre un lienzo o papel. El término se aplica sobre todo a la pintura, pero por extensión se puede referir a cualquier otra manifestación artística, como la música, el cine, la literatura o el videoclip.'),
(19, 'Textil', 'Artes textiles son los procesos de artesanía o manufactura en los que se utilizan fibras de origen vegetal, animal o sintético para construir objetos utilitarios o decorativos.'),
(20, 'Pintura', '¿Qué es el arte de la pintura?\r\nResultado de imagen para Pintura arte. La pintura es el arte de la representación gráfica utilizando pigmentos mezclados con otras sustancias aglutinantes orgánicas o sintéticas. La práctica del arte de pintar, consiste en aplicar, en una superficie determinada una hoja de papel, un lienzo, un muro, una madera, fragmento de tejido, etc.'),
(21, 'Escultura', 'Se llama escultura al arte de modelar el barro, tallar en piedra, madera u otros materiales. También se denomina escultura a la obra elaborada por un escultor.​Es una de las Bellas Artes en la cual el escultor se expresa creando volúmenes y conformando espacios.'),
(22, 'Fotografía', 'Se llama escultura al arte de modelar el barro, tallar en piedra, madera u otros materiales. También se denomina escultura a la obra elaborada por un escultor.​ Es una de las Bellas Artes en la cual el escultor se expresa creando volúmenes y conformando espacios.'),
(23, 'Ruedor', 'ratones');

